import React from 'react';
import { Link, useNavigate } from "react-router-dom";
import { shapes } from '../Data/Shapes';

import { useDispatch } from 'react-redux';
import { setSelectedShape } from '../Redux/actions'; // Assuming you have this action

function ShapeTerms() {

    const dispatch = useDispatch();

    function handleShapeClick({shape}) {
        dispatch(setSelectedShape({shape}));
    }

    return (
        <div>
            <h1>Shape Terms</h1>
            {shapes.map((shape, index) => (
                <Link to='/traditional-search' key={index} onClick={() => handleShapeClick({shape})}>
                    {shape}
                </Link>
            ))}
        </div>
    );
}

export default ShapeTerms;
